import Cardlist from './CardList';
import  { Robots } from './Robot';
import  SearchBox from './SearchBox';

const state = {
	Robots: Robots,
	searchfield: ''
}

class App extends Component {
	constructor(){
		super ();
	this.state = {
	Robots: Robots,
	searchfield: ''
		}
	}
	render() {
		return(
		<div className = 'tc'>
		<h1>Robofriends</h1>
		<SearchBox />
		<Cardlist Robots={ Robots }/>
		</div>
		);
	}
}

export default App;
